export default function Profile() {

  const [data, setData] = React.useState(null);
    React.useEffect(() => {
      setInterval(() => {
        fetch("/api")
        .then((res) => res.json())
        .then((data) => setData(data.message));

        if (data!="Cooking up your Summary")
          clearInterval();
      }, 1000);
    }, []);


  return (
    <>

<main>
  <span
    id="Underlay"
      className="w-full h-full absolute opacity-100 bg-gray-900"
  >
    <img src={require("assets/img/register.png")} />
  </span>
  <div className="lg:pt-12 pt-6 w-full md:w-12/12 px-4 text-center">
    <div className="relative flex flex-col min-w-0 break-words bg-grey-200 w-full mb-8 shadow-lg rounded-lg text-white">
      <div className="px-4 py-5 flex-auto">
        <h6 className="text-xl font-bold text-white">Summary of your Patent</h6>
        <p className="mt-2 mb-4 text-gray-600">
        <div className="lg:pt-12 pt-6 w-full md:w-12/12 px-4 text-center">
    <div id="summary" className="relative flex flex-col min-w-0 break-words bg-white w-full mb-8 shadow-lg rounded-lg text-black text-l font-semibold">

      <div className="px-4 py-5 flex-auto">
        </div>
</div></div> </p>     </div>
      </div>
    </div>

      </main>
    </>
  );
}
